import React from "react";

function Food(props) {
  console.log(props);
  return <h3>I love {props.fav}</h3>;
}

function App() {
  return (
    <div>
      <h1>hello</h1>
      <Food fav="kimchi" />
    </div>
  );
}

export default App;
